Defendant Timothy J Wietzke in court with Attorney Daniel Mcmurray.  Melissa Zilavy appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count #1.  Court performs plea colloquy and finds Defendant guilty of Count #1.  State gives sentencing recommendations.  Attorney Mcmurray makes statements regading sentencing.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #1:  IMPOSED AND STAYED SENTENCE OF:   

45 DAYS HUBER

TERM OF PROBATION:  1  YEAR

CONDITIONS OF PROBATON:  
____AODA Assessment and follow through with any treatment recommended;
____Absolute Sobriety;  Random U.A.'s ; 
____No Use or Possession of alcohol or illegal drugs 
____No Use or Possession of prescription drugs without a valid prescription;
____Any valid prescription drugs must be taken only in the manner in which they are 
prescribed/sign releases.
____Follow through with any treatment and/or counseling recommended by Agent;
____Maintain employment and/or combination of schooling 
____No VIOLENT contact with:  victim
____Domestic Violence Counseling through a State Certified Batterers Intervention Program such as Alliance Counseling or Family Services of Waukesha;

COSTS:  $343.00 & $200.00 DNA surcharge (to be paid as a condition of probation)
